import './Main.css';
import React from 'react';
import Promo from '../Promo/Promo';
import NavTab from '../NavTab/NavTab';

function Main() {
  return (
    <section className='main'>
      <Promo />
      <NavTab />
    </section>
  );
}

export default Main;
